import React from 'react';
import Search from './components/Search';
import MenuTab from './components/MenuTab';

function MenuPage() {
  return (
    <div style={{ padding: '50px' }}> 
      <Search />
      <MenuTab />
    </div>

  );
}

export default MenuPage;
